import './App.css';

const App = () => {
  return (
    <Header />
  );

  const Header = () => {
    return (
      <div>
        <a href='#s'>News</a>
        <a href='#s'>Menu</a>
        <a href='#s'>Messages</a>
        <a href='#s'>Settings</a>
      </div>);
  }
}

export default App;
